import React from 'react';
import StyledApp from '../style/sapp.tw';

const App = () => {
    return (
        <StyledApp>
            <form>
                <input type="text" placeholder="full name"/>
                <input type="text" placeholder="e-mail"/>
                <input type="text" placeholder="password"/>
                <button>Sign out</button>
            </form>
        </StyledApp>
    );
}

export default App;
